import React from 'react'
import { Link } from 'react-router-dom'
import styles from './Nav.module.css'
export default function Nav({links, logo}) {

    return (
        <div className="navbar-fixed">
            <nav className={styles.nav}>
                <div className="nav-wrapper container">
                    <Link to="/" className={`brand-logo ${styles.brand}`}>{logo}</Link>
                    <Link className="sidenav-trigger"><i className="material-icons">menu</i></Link>
                    <ul class="right hide-on-med-and-down">
                    {links.map((link, index)=>(
                        <li key={index}><Link to={link.href}>{link.title}</Link></li>
                    ))}
                    </ul>
                </div>
            </nav>            
            <ul class="sidenav">
            {links.map((link, index)=>(
                <li key={index}><Link to={link.href}>{link.title}</Link></li>
            ))}
            </ul>
        </div>

    )
}
